import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import Main from "./components/Main.js";

function Header() {
  return (
    <header>
      <h1>Frigus</h1>
    </header>
  );
}

function Footer(props) {
  return (
    <footer>
      <h1>Copyright {props.year} </h1>
      <h1>Contact info</h1>
    </footer>
  );
}

const containers = ["Top shelf", "Middle shelf", "Lower shelf"];

function App() {
  return (
    <div className="App">
      <Header />
      <Main containers={containers} />
      <Footer year={new Date().getFullYear()} />
    </div>
  );
}

const product = (
  <product>
    <h1>Manage me!</h1>
  </product>
);

const recipes = (
  <recipes>
    <h1>Cook me!</h1>
  </recipes>
);

export default App;
